    # get the row data and cut them naively (preparing for a for loop)
    with open("./tmp.tsv") as data:
        data_rows = [ln.replace("\n", "").split("\t") for ln in data.readlines()]
        data_rows = [row for row in data_rows if len(row) == 48]
    # delete the tmp file
    os.remove("./tmp.tsv")
    # create different reliability rows lists
    reliable_rows = [data_rows[0]]
    very_reliable_rows = [data_rows[0]]
    super_reliable_rows = [data_rows[0]]
    super_duper_reliable_rows = [data_rows[0]]

    # check row by row if the chapter and section correspond to the MEL mapped
    for row in data_rows:
        mel3 = "-".join(row[16].split("-")[:-1]) if len(row[16].split("-")) > 2 else row[16]
        # incorporate all "E" defect types
        if row[0] == "E":
            reliable_rows.append(row)
            very_reliable_rows.append(row)
            super_reliable_rows.append(row)
            super_duper_reliable_rows.append(row)
        # check the MEL code that matches exactly
        elif row[16] in mel_map["4based"]:
            if "{0}-{1}".format(row[8], row[9]) in mel_map["4based"][row[16]]:
                super_duper_reliable_rows.append(row)
                super_reliable_rows.append(row)
                very_reliable_rows.append(row)
                reliable_rows.append(row)
            # correct the row if it has only one chapter and section attributed to the mel nb
            elif len(mel_map["4based"][row[16]]) == 1:
                chap_sect = list(mel_map["4based"][row[16]])[0]
                corrected_row = row[:8]+chap_sect.split("-")+row[10:]
                super_reliable_rows.append(corrected_row)
                very_reliable_rows.append(corrected_row)
                reliable_rows.append(corrected_row)

        # check the MEL code that matches the 3 firsts numbers
        elif mel3 in mel_map["3based"]:
            if "{0}-{1}".format(row[8], row[9]) in mel_map["3based"][mel3]:
                very_reliable_rows.append(row)
                reliable_rows.append(row)
            # correct the row if it has only one chapter and section attributed to the mel nb
            elif len(mel_map["3based"][mel3]) == 1:
                chap_sect = list(mel_map["3based"][mel3])[0]
                corrected_row = row[:8] + chap_sect.split("-") + row[10:]
